@Footballogue Vous nous cassez les bonbons.
Vous êtes là pour nous divertir 
On s’en fout de savoir si vous êtes de gauche ou de droite, pour ou contre la charia et si vous luttez contre les oppressions que subissent les peuples. Jouez au foot et ouvrez vos bouches que pour parler football!!!
